check_line_of_text :: String -> Bool
check_line_of_text line_of_text = if ((length $ filter (\x -> (length x) > 1) $ group $ sort $ words line_of_text) > 0) then False else True


check :: String -> Int
check "" = 0
check text
  | check_line_of_text current_line = (check rest_of_text) + 1
  | otherwise =  check rest_of_text
  where
    spanned = span (/= '0') text
    current_line = fst spanned
    rest_of_text = tail (snd spanned)
